import React, { Component } from "react";
import UserDataService from "../services/user.service";
import { Link} from "react-router-dom";
import "./maze.css"

export default class Prob1 extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: null,
      answer:"",
      ip: "",
      time:"",
      submitted: false
    };
  }

  render() {
    return (
      <div>
        <table>
          <tr>
            <td>
              <div className="story">
                <div className="marginbottom">스토리</div>
              </div>
            </td>
          </tr>
          <tr>
            <td>
              <hr className="hline"></hr>
            </td>
          </tr>
          <tr className="story">
            <div className="marginbottom">문제</div>               
          </tr>
          <tr>
            <td>

            </td>
            <td>              
              <Link to="/Home" className={'btn'}>이동</Link>
            </td>       
          </tr>
        </table>        
      </div>
    );
  }
}
